// ===== Ministries Stats =====

/** Async Action Creator */
export function loadMinistriesStatsConfig(): AsyncLoaderEntry {
  return {
    key: 'ministriesStats',
    promise: (context: AsyncContext) => {
      return loadMinistriesStats(context);
    },
  };
}

